import React from 'react'
import Pizza from './Pizza'

const Order = (props) => {
if (props.result) {
  const pizzas = props.result.pizzas.map((pizza, index) => <Pizza pizza={pizza} key={index} />)
} else {
    pizzas = <div></div>
}

  return (
    <div className="order">
      <div className="text-light"> <h1 className="order header">Pizzas in Order</h1> </div>
      <div className="pizzas">
        {pizzas}
      </div>
    </div>
  )
}

export default Order
